  false,\n\t\"url\": null,\n\t\"notes\": \"This manual has been generated in response
  to the needs of the National Wildlife Refuge System in USFWS Region to protect habitat
  of overwintering waterfowl.  Its purpose is to aid in developing a basic program
  to monitor water quality and vegetational changes on refuges.  The objective of
  the monitoring program might be thought of as the establishment of a safety net,
  catching trends in water quality in time for managers to take action and prevent
  habitat damage.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
